1. Create a frame that will serve as the dashboard. You could specify its size, position, and any other attributes like corner radius and background color.

```tsx
await axios.post("/api/functions/create_frame", {
  x: 0,
  y: 0,
  width: 1280,
  height: 800,
  name: "Admin Dashboard",
  fillColor: { r: 0.96, g: 0.96, b: 0.96, a: 1 },
});
```

2. Create a frame that will serve as the side navigation bar

```tsx
await axios.post("/api/functions/create_frame", {
  x: 10,
  y: 10,
  width: 150,
  height: 780,
  name: "Side NavBar",
  fillColor: { r: 0.1, g: 0.1, b: 0.1, a: 1 },
});
```

3. Create some text elements for navigation items. For instance, "Users", "Posts", and "Analytics".

```tsx
await axios.post("/api/functions/create_text", {
  x: 20,
  y: 20,
  text: "Users",
  fontSize: 16,
  fontColor: { r: 1, g: 1, b: 1, a: 1 },
  parentId: "Side NavBar",
});

await axios.post("/api/functions/create_text", {
  x: 20,
  y: 60,
  text: "Posts",
  fontSize: 16,
  fontColor: { r: 1, g: 1, b: 1, a: 1 },
  parentId: "Side NavBar",
});

await axios.post("/api/functions/create_text", {
  x: 20,
  y: 100,
  text: "Analytics",
  fontSize: 16,
  fontColor: { r: 1, g: 1, b: 1, a: 1 },
  parentId: "Side NavBar",
});
```

4. Create another frame for the main content area.

```tsx
await axios.post("/api/functions/create_frame", {
  x: 170,
  y: 10,
  width: 1100,
  height: 780,
  name: "Main Content",
});
```

5. Fill the main content area with whatever elements you need. For instance, if you're on the "Users" page, you might create a list of user elements

```tsx
for (let i = 0; i < 10; i++) {
  await axios.post("/api/functions/create_frame", {
    x: 10,
    y: i * 80,
    width: 1080,
    height: 70,
    name: `User${i}`,
    parentId: "Main Content",
  });

  await axios.post("/api/functions/create_text", {
    x: 10,
    y: 10,
    text: `User ${i}`,
    fontSize: 16,
    parentId: `User${i}`,
  });

  // And so on for other user fields...
}
```

This is a basic example. You would adapt it to fit the needs of your actual dashboard, including interactive elements, different pages, and more.
